function getRandom(arr) {
  return arr[Math.floor(Math.random() * arr.length)];
}

function GetSpellName() {
  let name = "";
  for (let i = 0; i < 3; i++) {
    name += getRandom(DescriptionWords);
  }

  return name;
}

function GetDescription(wordCount) {
  let description = "";
  for (let i = 0; i < wordCount; i++) {
    description += getRandom(DescriptionWords) + " ";
  }

  return description;
}

function getRandomlyGeneratedSpell() {
  let name = GetSpellName();
  let desc = GetDescription(14);
  return `<Spell itemID="${name}">
        ${getRandom(StatsArr)}
        <HitAllies></HitAllies>
        <HitEnemies>true</HitEnemies>
        <HitSelf></HitSelf>
        <HitStructures>true</HitStructures>
        <Name>${name}</Name>
        <Tags>Player</Tags>
        <Action>${getRandom(Actions)}</Action>
        <Description>${desc}</Description>
        <Meta>${desc}</Meta>
        <Rarity>${Math.floor(Math.random() * 5)}</Rarity>
        <Brand>${getRandom(brands)}</Brand>
        <Mana>${Math.floor(Math.random() * 2 + 1)}</Mana>
        <Damage>${Math.floor(Math.random() * 11 + 1) * 10}</Damage>
        <Shots>${getRandom(MultiShotShots)}</Shots>
        <Tiles>${getRandom(Tiles)}</Tiles>
        ${getRandom(locationArr)}
        <TimeBetweenShots>${getRandom(TimeBetweenShots)}</TimeBetweenShots>
        <ShotVelocity>${getRandom(MutliShotVelocity)}</ShotVelocity>
        <ShotDuration>${getRandom(MultiShotDuration)}</ShotDuration>
        <ShotDelay>0</ShotDelay>
        <CastDelay>0</CastDelay>
        <BlastDuration>${getRandom(BlastDuration)}</BlastDuration>
        <WarningDuration>0</WarningDuration>
        <DestroyOnHit>true</DestroyOnHit>
        ${getRandom(onHit)}
    </Spell>`
}

var generateBtn = document.querySelector('#generate');


function createSpell() {
  var spell = getRandomlyGeneratedSpell();
  var spellText = document.querySelector('#spell');

  spellText.value = spell;
}


generateBtn.addEventListener('click', createSpell);
